import React from "react";
import { NavLink } from "react-router-dom";
import "./home.css";
import web from "../src/images/home.jpg";

const Home = () => {
  return (
    <>
      <div className="container-fluid mainBox">
        <div className="row px-5 d-flex align-items-center justify-content-between">
          <div className="col-md-6 mx-auto text-center">
            <h1 className=" intro">
              Hi, I'm
              <span className="text-primary fw-bolder pt-3 name"> Satyam</span>
            </h1>
            <h6 className="pb-1">Programmer Web Developer Photographer</h6>
            <NavLink to="/about">
              <button className="btn btn-outline-primary border-2 rounded-pill w-25">
                About Me
              </button>
            </NavLink>
          </div>
          <div className="col-md-6 mx-auto homeRight">
            <img className="img-fluid" src={web} alt="logo" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
